import React, { Component } from 'react';
import {Jumbotron, Grid, Row, Col, Image} from 'react-bootstrap';
import './News.css'


class News extends Component {
  render() {
    return (
      <div>
        <Image src="assets/mountain-man.jpg" className="header-image"/>
      </div>
    );
  }
}

export default News;
